function displayAlerts() {
	//Display alerts in top and bottom of page
	var alertHTML = "<strong>";
	alertList.forEach(function(a){
		alertHTML = alertHTML + "<br>" + a.message;
	});
	alertHTML = alertHTML + "</strong>";
	$("#alertListTop").html(alertHTML);
	$("#alertListBottom").html(alertHTML);
}

function addAlert(m, t) {
	//Add alert m of type t to list
	var a = new Alert();
	a.message = m;
	a.type = t;
	var alertFound = false;
	alertList.forEach(function(al) {
		if (al.type == t) {
			alertFound = true;
		}
	});
	if (!alertFound) {
		alertList.push(a);
	}
	displayAlerts();
}

function removeAlerts(t) {
	//Clear alerts of specific type t
	for (var i = alertList.length - 1; i >=0; i--) {
		if (alertList[i].type == t) {
			alertList.splice(i,1);
		}
	}
	displayAlerts();
}

function subtractDates(date1,date2) {
	//Subtract two dates in String format
	var diff = 0;
	if(date1 != "" && date2 != "") {
		var month1 = Number(date1.substring(2,0));
		var day1 = Number(date1.substring(5,3));
		var year1 = Number(date1.substring(10,6));
		var month2 = Number(date2.substring(2,0));
		var day2 = Number(date2.substring(5,3));
		var year2 = Number(date2.substring(10,6));	
		var Date1 = new Date(year1,month1-1,day1);
		var Date2 = new Date(year2,month2-1,day2);
		var diffMS = Math.abs(Date1 - Date2);
		diff = Math.round(diffMS / 86400000);
		if (year1 > year2 || (year1 == year2 && month1 > month2) || (year1 == year2 && month1 == month2 && day1 > day2)) {
			//Nothing
		} else {
			diff = diff * (-1);
		}
	}
	return diff; //Returns number of days apart
}

function checkDateValidity(dat,type) {
	//Checks validity of dates
	var dateFuture = false;
	var datePast = false;
	var dateInvalid = false;
	var month = Number(dat.substring(2,0));
	var day = Number(dat.substring(5,3));
	var year = Number(dat.substring(10,6));	

	var currentTime = new Date();
	var currMonth = currentTime.getMonth() + 1;
	var currDay = currentTime.getDate();
	var currYear = currentTime.getFullYear();
	
	if (dat == "" || dat == " ") {
		removeAlerts(type);
	} else {
		if (year > currYear) {
			dateFuture = true;
		} else if (year == currYear && month> currMonth) {
			dateFuture = true;
		} else if (year == currYear && month == currMonth && day > currDay) {
			dateFuture = true;
		}
		if (year < 1980) {
			datePast = true;
		}
		if (month > 12) {
			dateInvalid = true;
		}
		if (day > 31) {
			dateInvalid = true;
		}
		if (month == 4 || month == 6 || month == 9 || month == 11 ) {
			if (day > 30) {
				dateInvalid = true;
			}
		}
		if (month == 2 && day > 29) {
			dateInvalid = true;
		}
		if (datePast) {
			addAlert(type + " is way in the past.",type);
		}
		if (dateFuture) {
			addAlert(type + " is in the future.",type);
		}
		if (dateInvalid) {
			addAlert(type + " is invalid.",type);
		}
		if(!dateInvalid && !dateFuture && !datePast) {
			removeAlerts(type);
		}
	}
}

