function verifyCapitalization(elementID) {
	//Verifies capitalization and corrects it automatically
	var myString = $(elementID).val();
	var strArray = myString.split(' ');
	var finalString = "";
	var finalWord = "";
	var capInMiddle = false;
	strArray.forEach(function(s){
		finalWord = "";
		capInMiddle = false;
		if (s.length > 2) {
			if (s[0].toUpperCase() == s[0] && s[1].toLowerCase() == s[1]) {
				for (var i =2; i < s.length; i++) {
					if (s[i].toUpperCase() == s[i]) {
						capInMiddle = true;
					}
				}
			}
		}
		var sLower = s.toLowerCase();
		if (capInMiddle == true) {
			finalWord = s;
		}else if (sLower == "and" || sLower == "or" || sLower == "a" || sLower == "an" || sLower == "the" || sLower == "of" || sLower == "on" || sLower == "for" || sLower == "by" || sLower == "with") {
			if ( s == s.toUpperCase() ) {			
				finalWord = s;
			} else {
				if (s == strArray[0]) {
					//Capitalize first letter
					finalWord = s[0].toUpperCase();
					//Lower case everything else
					for (var j = 1; j < s.length; j++) {
						finalWord = finalWord + s[j].toLowerCase();
					}
				} else {
					finalWord = s.toLowerCase();
				} //  if s == strArray
			} // if s = s.toLowerCase
		}else if (s == s.toUpperCase()) {
			finalWord = s;
		} else {
			//Capitalize first letter
			finalWord = s[0].toUpperCase();
			//Lower case everything else
			for (var k = 1; k < s.length; k++) {
				finalWord = finalWord + s[k].toLowerCase();
			}
		}
		finalString = finalString + finalWord + " ";
	});
	finalString = finalString.slice(0, -1);
	var chaseRule = $(elementID).val();
	if (chaseRule.toLowerCase() == "jpmorgan chase") {
		finalString = "JPMorgan Chase";
	} 
	//Prevent automatic capitalization with apostrophe
	if (myString[0] == "'") {
		finalString = myString.slice(1,myString.length);
	}
	$(elementID).val(finalString);
	if(elementID == payorD) {
		checkPayorType(finalString);
	}
}

function verifyPunctuation(elementID) {
	//Remove any punctuation or extra spaces from textbox
	var myString = $(elementID).val();
	var punctuationless = myString.replace(/[.,\/#!$%\^&\*;:{}=\-_`~()]/g,"");
	var finalString = punctuationless.replace(/\s{2,}/g," ");
	finalString = finalString.trim();
	$(elementID).val(finalString);
}

